Gutes Video. Audio ist gut, du bist klar zu verstehen und die Musik ist in einer angenhemen Lautstärke.
Nur deine Schnitte dürften etwas schneller und spannender gestaltet sein. War für eine Art von Montage etwas langsam.
Und wie du selbst im Video sagst, darfst gerne versuchen mehr zu reden während des Spiels. Aber das ist recht schwer, kommt wahrscheilich mit übung ;){{sticker:sg-ahri-2}}
